import com.google.common.collect.EnumHashBiMap;

public class EnumValueMap {
    private EnumHashBiMap<ExampleEnum, String> enumHashBiMap;

    public EnumValueMap() {
        enumHashBiMap = EnumHashBiMap.create(ExampleEnum.class);
    }

